package com.core;

public class OperatorsProgram2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int a=3;
int b=5;
int c=7;
int d=9;
int e=15;
int f=14;
int g=15;
int h=17;               
int i=24;
System.out.println(a>b);//3>5
System.out.println(d>c);//9>7
System.out.println(c<d);//7<9
System.out.println(e<=h);//15<=17
System.out.println(e>=i);//15>=24
System.out.println(e==g);//15==15
System.out.println(f!=h);//14!=17

	}

}
